// Order Number Input and Item Dropdown Component
type OrderItem = {
  item_id: string;
  item_name: string;
};

type OrderDetails = {
  purchase_date: string;
  items: OrderItem[];
};

export function OrderSelector() {
  const [orderNumber, setOrderNumber] = useState("");
  const [orderValid, setOrderValid] = useState<boolean | null>(null);
  const [orderDetails, setOrderDetails] = useState<OrderDetails | null>(null);
  const [checking, setChecking] = useState(false);
  const [items, setItems] = useState<OrderItem[]>([]);
  const [selectedItem, setSelectedItem] = useState("");

  // Fetch order details when order number changes
  useEffect(() => {
     if (!orderNumber) {
      setOrderValid(null);
      setItems([]);
      setSelectedItem("");
      return;
    }

    setChecking(true);
    axios
      .get(`http://localhost:8000/orders/${orderNumber}/items`)
      .then((response) => {
        setItems(response.data); // backend returns list of OrderItem
        setOrderValid(response.data.length > 0);
        setSelectedItem(""); // reset selected item
      })
      .catch((error) => {
        console.error("Error fetching order:", error);
        setOrderValid(false);
        setItems([]);
        setSelectedItem("");
      })
      .finally(() => setChecking(false));
  }, [orderNumber]);

    return (
    <div className="flex flex-col gap-4">
      {/* Order Number Input */}
      <div>
        <label className="block text-[20px] font-semibold text-[#242426]">
          Order Number:
        </label>
        <input
          type="text"
          inputMode="numeric"
          value={orderNumber}
          onChange={e => setOrderNumber(e.target.value.replace(/[^0-9]/g, ""))}
          placeholder="Enter order number"
          style={{ width: "220px", fontSize: "18px", padding: "8px", border: "1px solid #ccc" }}
        />
        {checking && <span style ={{ color: "#888", fontSize: "14px" }}>Checking...</span>}
        {orderValid == false && (
          <span style={{ color: "red", fontSize: "14px" }}>Order number not found. Please try again.</span>
        )}
        {orderValid === true && orderDetails && (
          <div style={{ marginTop: "8px", fontSize: "14px", color: "green" }}>
            <strong>Order found!</strong><br />
            Purchase Date: {orderDetails.purchase_date}<br />
            Items: {orderDetails.items.map((item:any) => item.item_name).join(", ")}
          </div>
        )}
      </div>
      {/* Item Dropdown */}
       {orderValid && items.length > 0 && (
        <div>
          <label className="block text-[20px] font-semibold text-[#242426]">
            Select Item:
          </label>
          <select
            value={selectedItem}
            onChange={(e) => setSelectedItem(e.target.value)}
            style={{
              minWidth: "220px",
              height: "40px",
              borderRadius: "8px",
              border: "1px solid #d9d9d9",
              padding: "8px",
              fontSize: "16px",
              background: "#fff",
              color: "#1e1e1e",
            }}
          >
            <option value="">Select Item</option>
            {items.map((item) => (
              <option key={item.item_id} value={item.item_id}>
                {item.item_name}
              </option>
            ))}
          </select>
        </div>
      )}
    </div>
  );
}
